import React from "react";
import notes from "../notes";

function Note(){
    return notes.map(noteEntry=>{
         <div className = "note">
        <h1>{noteEntry.titl}</h1>
        <p>{noteEntry.content}</p>
    </div>
    });
    
}

export default Note ;
